import './App.css';
import Navbar from './Components/Navbar';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './Components/Home';
import Footer from './Components/Footer';

function App() {
  return (
    <div className="App">
     <Navbar />
     <BrowserRouter>
        <Routes>
          <Route exact path='/' element={<Home/>}/>

        </Routes>
     </BrowserRouter>
     <Footer />
    </div>
  );
}

export default App;
